import React from "react";

const Profile = () => {
  return (
    <div className="grid grid-cols-3">
      <div className="bg-purple-200 h-screen p-2">Profile Pic</div>
      <div className="col-span-2 bg-red-200 h-screen">Info</div>
    </div>
  );
};

export default Profile;
